import React from 'react';
import {Show, SimpleShowLayout, TextField, DateField, BooleanField} from 'react-admin';

const CompetitionShow = (props) => {
    return (
        <Show {...props}>
            <SimpleShowLayout>
                <TextField source='id' />
                <TextField source='name' />
                <TextField source='creator.email' />
                <DateField source='deadline' />
                <BooleanField label = 'Visibility' source='currentVisibility'/>
            </SimpleShowLayout>
        </Show>
    )
};

export default CompetitionShow;
